import React, { useState } from 'react';
import axios from 'axios';

function App() {
    const [domain, setDomain] = useState('');
    const [backlinks, setBacklinks] = useState([]);

    const fetchBacklinks = async () => {
        try {
            const response = await axios.post('http://localhost:3001/getBacklinks', { domain });
            setBacklinks(response.data.backlinks);
        } catch (error) {
            console.error('Error fetching backlinks:', error);
        }
    };

    return (
        <div className="App">
            <h1>Backlink Checker</h1>
            <input 
                type="text" 
                value={domain}
                onChange={(e) => setDomain(e.target.value)}
                placeholder="Enter domain"
            />
            <button onClick={fetchBacklinks}>Check Backlinks</button>

            {backlinks.length > 0 && (
                <table>
                    <thead>
                        <tr>
                            <th>Source URL</th>
                            <th>Target URL</th>
                            <th>Anchor Text</th>
                        </tr>
                    </thead>
                    <tbody>
                        {backlinks.map((backlink, index) => (
                            <tr key={index}>
                                <td>{backlink.source_url}</td>
                                <td>{backlink.target_url}</td>
                                <td>{backlink.anchor_text}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
}

export default App;
